    const {id} = useParams();
    // const NotesList = useOutletContext();

    const navigator=useNavigate();

    return (
    <>
    <div className= {` notes_lists_cards ${ notes.id=== active && "notes_active"}`}
    onClick={() =>{ setActive(notes.id);
    navigator('/notes/'+notes.id+"/edit")}}>
        {/* <div>SHIVAM</div> */}
     <div >{notes.Title}</div><div>{notes.Date}</div><div>{notes.Body}</div></div>
</>
    )
    }
